      <div>
        <img src={kratos} alt="kratos" />
        <span>Kratos</span>
      </div>
      <div>
        <img src={magneto} alt="magneto" />
        <span>Magneto</span>
      </div>
      <div>
        <img src={zelda} alt="zelda" />
        <span>Zelda</span>
      </div>
    </div>
  );
}
